import React, { Component } from 'react'
import SearchCouse from '../../Containers/SearchCouse'

export default class Cover extends Component {
    render() {
        return (
            <>
                <div className="cover-content mt-5">
                    <h1>KHÓA HỌC DÀNH CHO BẠN</h1>
                    <p>Learn technology, creative and business skills you can use today.</p>
                    <div className="input">
                        {/* sử dụng input group */}
                        <div className="input_search">
                            {/* sử dụng input group */}
                          <SearchCouse/>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}
